import React from "react";

function FileTree({ nodes }) {
  return (
    <ul>
      {nodes.map((node) => (
        <li key={node.id}>
          {node.mimeType === "application/vnd.google-apps.folder" ? (
            <strong>üìÅ {node.name}</strong>
          ) : (
            <span>üìÑ {node.name}</span>
          )}
          {node.children && node.children.length > 0 && (
            <FileTree nodes={node.children} />
          )}
        </li>
      ))}
    </ul>
  );
}

export default FileTree;
